import React from "react";
import { Outlet, Route, Routes } from "react-router-dom";
import NavBar from "../NavBar";
import Footer from "../Footer";
import Login from "../Login";
import Register from "../Register";
import ShowAllHTLocation from "../ShowAllHTLocation";
import VerifyEmail from "../VerifyEmail";
import MyProfile from "../MyProfile";

const Project = () => {
  return (
    <>
      <Routes>
        <Route
          path="/"
          element={
            <>
              <NavBar></NavBar>
              <Outlet></Outlet>
              <Footer></Footer>
            </>
          }
        >
          <Route path="verify-email" element={<VerifyEmail></VerifyEmail>}></Route>
          <Route index element={<div>Home Page</div>}></Route>
          <Route
            path="login"
            element={
              <>
                <Outlet></Outlet>
              </>
            }
          >
            <Route index element={<Login></Login>}></Route>
          </Route>
          <Route path="register" element={<Register></Register>}></Route>
          <Route path="hTLocation" element={<Outlet></Outlet>}>
            <Route
              index
              element={<ShowAllHTLocation></ShowAllHTLocation>}
            ></Route>
          </Route>
            <Route path="users" element={<Outlet></Outlet>}>
              <Route path="my-profile" element={<Outlet></Outlet>}>

                <Route index element={<><MyProfile></MyProfile></>}></Route>

                <Route path="update" element={<UpdateMyProfile></UpdateMyProfile>}></Route>
                
              </Route>



            </Route>
        </Route>
      </Routes>
    </>
  );
};

export default Project;
